import React from 'react'
import AliceCarousel from 'react-alice-carousel';
import "react-alice-carousel/lib/alice-carousel.css";
import {CarouselWrapper, CarouselImgs} from './carouselElements'
import one from '../../pics/creative.svg';
import two from '../../pics/creative2.svg';
import three from '../../pics/em2.jpg';
import four from '../../pics/makeup.svg';
import five from '../../pics/film.svg';

const Carousel = () => {

    const responsive = {
        0: {items: 1},
        1024: {items: 2},
    }

    return (
        <CarouselWrapper>
            <AliceCarousel autoPlay infinite responsive={responsive} autoPlayInterval="3000" autoPlayStrategy='none' >
                <CarouselImgs src={one} alt='' className='sliderimg'/> 
                <img src={two} alt='' className='sliderimg'/> 
                <img src={three} alt='' className='sliderimg'/> 
                <img src={four} alt='' className='sliderimg'/> 
                <img src={five} alt='' className='sliderimg'/> 

            </AliceCarousel>
        </CarouselWrapper>
    )
}

export default Carousel
